import React from 'react';
import { useOdontoStates } from "../Context/Context";
import Card from '../Components/Card';

const Home = () => {
  const { odontologos, favs } = useOdontoStates();

  const isAlreadyFav = (odontologo) => {
    return favs.some((fav) => fav.id === odontologo.id);
  };

  return (
    <main className="" >
      <h1>Home</h1>
      <div className='card-grid'>
        {odontologos.map(odontologo => (
          <Card
            odontologo={odontologo}
            key={odontologo.id}
            isFav={isAlreadyFav(odontologo)} // Verifica si ya está en Destacados
          />
        ))}
      </div>
    </main>
  );
}

export default Home;
